[{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"CurrentModule = MixedModelsMakie\nDocTestSetup = quote\n    using MixedModelsMakie\nend\nDocTestFilters = [r\"([a-z]*) => \\1\", r\"getfield\\(.*##[0-9]+#[0-9]+\"]","category":"page"},{"location":"api/#MixedModelsMakie.jl-API","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"","category":"section"},{"location":"api/#Coefficient-Plots","page":"MixedModelsMakie.jl API","title":"Coefficient Plots","text":"","category":"section"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"coefplot","category":"page"},{"location":"api/#MixedModelsMakie.coefplot","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.coefplot","text":"coefplot(x::MixedModel;\n         conf_level=0.95, vline_at_zero=true, show_intercept=true, attributes...)\ncoefplot(x::MixedModelBootstrap;\n         conf_level=0.95, vline_at_zero=true, show_intercept=true, attributes...)\n\nCreate a coefficient plot of the fixed-effects and associated confidence intervals.\n\nnote: Note\nThis functionality is implemented using Makie recipes and thus there are also additional auto-generated methods for coefplot and coefplot! that may be useful when constructing more complex figures.\n\n\n\n\n\n","category":"function"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"using CairoMakie\nusing MixedModels\nusing MixedModelsMakie\nusing Random\n\nverbagg = MixedModels.dataset(:verbagg)\n\ngm1 = fit(MixedModel,\n          @formula(r2 ~ 1 + anger + gender + btype + situ + (1|subj) + (1|item)),\n          verbagg,\n          Bernoulli();\n          progress=false)\n\ncoefplot(gm1)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"sleepstudy = MixedModels.dataset(:sleepstudy)\n\nfm1 = fit(MixedModel, @formula(reaction ~ 1 + days + (1 + days|subj)), sleepstudy; progress=false)\nboot = parametricbootstrap(MersenneTwister(42), 1000, fm1)\n\ncoefplot(boot; conf_level=0.999, title=\"Custom Title\")","category":"page"},{"location":"api/#Ridge-Plots","page":"MixedModelsMakie.jl API","title":"Ridge Plots","text":"","category":"section"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"ridgeplot","category":"page"},{"location":"api/#MixedModelsMakie.ridgeplot","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.ridgeplot","text":"ridgeplot(x::MixedModelBootstrap;\n          conf_level=0.95, vline_at_zero=true, show_intercept=true,\n          attributes...)\n\nCreate a ridge plot for the bootstrap samples of the fixed effects.\n\nDensities are normalized so that the maximum density is always 1.\n\nThe highest density interval correspoding to conf_level is marked with a bar at the bottom of each density. Setting conf_level=missing removes the markings for the highest density interval.\n\nnote: Note\nThis functionality is implemented using Makie recipes and thus there are also additional auto-generated methods for ridgeplot and ridgeplot! that may be useful when constructing more complex figures.\n\n\n\n\n\n","category":"function"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"ridgeplot(boot)","category":"page"},{"location":"api/#Random-effects-and-group-level-predictions","page":"MixedModelsMakie.jl API","title":"Random effects and group-level predictions","text":"","category":"section"},{"location":"api/#Caterpillar-Plots","page":"MixedModelsMakie.jl API","title":"Caterpillar Plots","text":"","category":"section"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"RanefInfo","category":"page"},{"location":"api/#MixedModelsMakie.RanefInfo","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.RanefInfo","text":"RanefInfo\n\nInformation on random effects conditional modes/means, variances, etc.\n\nUsed for creating caterpillar plots.\n\nnote: Note\nThis functionality may be moved upstream into MixedModels.jl in the near future.\n\n\n\n\n\n","category":"type"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"ranefinfo","category":"page"},{"location":"api/#MixedModelsMakie.ranefinfo","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.ranefinfo","text":"ranefinfo(m::MixedModel)\n\nReturn a NamedTuple{fnames(m), NTuple(k, RanefInfo)} from model m\n\n\n\n\n\nranefinfo(m::MixedModel, gf::Symbol)\n\nReturn a RanefInfo corresponding to the grouping variable gf model m.\n\n\n\n\n\n","category":"function"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"caterpillar","category":"page"},{"location":"api/#MixedModelsMakie.caterpillar","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.caterpillar","text":"caterpillar(m::LinearMixedModel, gf::Symbol)\n\nReturns a Figure of a \"caterpillar plot\" of the random-effects means and prediction intervals\n\nA \"caterpillar plot\" is a horizontal error-bar plot of conditional means and standard deviations of the random effects.\n\n\n\n\n\n","category":"function"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"caterpillar!","category":"page"},{"location":"api/#MixedModelsMakie.caterpillar!","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.caterpillar!","text":"caterpillar!(f::Figure, r::RanefInfo; orderby=1)\n\nAdd Axes of a caterpillar plot from r to f.\n\nThe order of the levels on the vertical axes is increasing orderby column of r.ranef, usually the (Intercept) random effects. Setting orderby=nothing will disable sorting, i.e. return the levels in the order they are stored in.\n\nnote: Note\nEven when not sorting the levels, they might have already been sorted during model matrix construction. If you want impose a particular ordering on the levels, then you must sort the relevant fields in the RanefInfo object before calling caterpillar!.\n\n\n\n\n\n","category":"function"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"using CairoMakie\nCairoMakie.activate!(type = \"svg\")\nusing MixedModels\nusing MixedModelsMakie\nsleepstudy = MixedModels.dataset(:sleepstudy)\nverbagg = MixedModels.dataset(:verbagg)\n\nfm1 = fit(MixedModel, @formula(reaction ~ 1 + days + (1 + days|subj)), sleepstudy; progress=false)\ngm0 = fit(MixedModel,\n          @formula(r2 ~ 1 + anger + gender + btype + situ + (1|subj) + (1|item)),\n          verbagg,\n          Bernoulli();\n          progress=false)\n\nsubjre = ranefinfo(fm1)[:subj]\n\ncaterpillar!(Figure(; resolution=(800,600)), subjre)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"caterpillar!(Figure(; resolution=(800,600)), subjre; orderby=2)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"caterpillar!(Figure(; resolution=(800,600)), subjre; orderby=nothing)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"caterpillar(gm0, :item)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"qqcaterpillar","category":"page"},{"location":"api/#MixedModelsMakie.qqcaterpillar","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.qqcaterpillar","text":"qqcaterpillar(m::LinearMixedModel, gf::Symbol=first(fnames(m)); cols=nothing)\n\nReturns a Figure of a \"qq-caterpillar plot\" of the random-effects means and prediction intervals.\n\nThe display can be restricted to a subset of random effects associated with a grouping variable by specifying cols, either by indices or term names.\n\n\n\n\n\n","category":"function"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"qqcaterpillar!","category":"page"},{"location":"api/#MixedModelsMakie.qqcaterpillar!","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.qqcaterpillar!","text":"qqcaterpillar!(f::Figure, r::RanefInfo; cols=axes(r.cnames, 1))\n\nUpdate the figure with a caterpillar plot with the vertical axis on the Normal() quantile scale.\n\nThe display can be restricted to a subset of random effects associated with a grouping variable by specifying cols, either by indices or term names.\n\n\n\n\n\n","category":"function"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"qqcaterpillar(fm1)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"qqcaterpillar(gm0, :item)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"qqcaterpillar!(Figure(; resolution=(400,300)), subjre; cols=[1])","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"qqcaterpillar!(Figure(; resolution=(400,300)), subjre; cols=[:days])","category":"page"},{"location":"api/#Shrinkage-Plots","page":"MixedModelsMakie.jl API","title":"Shrinkage Plots","text":"","category":"section"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"shrinkageplot\nshrinkageplot!","category":"page"},{"location":"api/#MixedModelsMakie.shrinkageplot","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.shrinkageplot","text":"shrinkageplot(m::MixedModel, gf::Symbol=first(fnames(m)), θref)\n\nReturn a scatter-plot matrix of the conditional means, b, of the random effects for grouping factor gf.\n\nTwo sets of conditional means are plotted: those at the estimated parameter values and those at θref. The default θref results in Λ being a very large multiple of the identity.  The corresponding conditional means can be regarded as unpenalized.\n\n\n\n\n\n","category":"function"},{"location":"api/#MixedModelsMakie.shrinkageplot!","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.shrinkageplot!","text":"shrinkageplot!(f::Figure, m::MixedModel, gf::Symbol=first(fnames(m)), θref)\n\nReturn a scatter-plot matrix of the conditional means, b, of the random effects for grouping factor gf.\n\nTwo sets of conditional means are plotted: those at the estimated parameter values and those at θref. The default θref results in Λ being a very large multiple of the identity.  The corresponding conditional means can be regarded as unpenalized.\n\n\n\n\n\n","category":"function"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"using CairoMakie\nusing MixedModels\nusing MixedModelsMakie\nsleepstudy = MixedModels.dataset(:sleepstudy)\n\nfm1 = fit(MixedModel, @formula(reaction ~ 1 + days + (1 + days|subj)), sleepstudy; progress=false)\nshrinkageplot(fm1)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"shrinkageplot!(Figure(; resolution=(400,400)), fm1)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"gm1 = fit(MixedModel,\n          @formula(r2 ~ 1 + anger + gender + btype + situ + (1|subj) + (1+gender|item)),\n          verbagg,\n          Bernoulli();\n          progress=false)\nshrinkageplot(gm1)","category":"page"},{"location":"api/#Diagnostics","page":"MixedModelsMakie.jl API","title":"Diagnostics","text":"","category":"section"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"We have also provided a few useful plot recipes for common plot types applied to mixed models. These are especially useful for diagnostics and model checking.","category":"page"},{"location":"api/#QQ-Plots","page":"MixedModelsMakie.jl API","title":"QQ Plots","text":"","category":"section"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"The methods for qqnorm and qqplot are implemented using Makie recipes. In other words, these are convenience wrappers for calling the relevant plotting methods on residuals(model).","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"Specify the type of line on the QQ plots with the qqline keyword-argument. The default for qqnorm is :fitrobust, which delivers an R-style line connecting the first and third quartiles. The default for qqplot is :identity, which plots the line with slope = 1 and intercept = 0. The final possiblity is :fit, which plots the line of best fit (i.e. regressing the quantiles of the residuals onto the quantiles of the reference distribution).","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"The reference distribution for qqnorm is the standard normal, which differs from the behavior in previous versions of Makie.","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"compat: Compat\nThe options and associated names for the qqline keyword argument changed in Makie 0.16.3 (and were broken in Makie 0.16.0-0.16.2). The equivalent to qqline=:R is qqline=:fitrobust. qqline=:R will be supported for backwards compatibility only until the next breaking release.","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"using CairoMakie\nusing MixedModels\nusing MixedModelsMakie\n\nsleepstudy = MixedModels.dataset(:sleepstudy)\n\nfm1 = fit(MixedModel, @formula(reaction ~ 1 + days + (1 + days|subj)), sleepstudy; progress=false)\nqqnorm(fm1; qqline=:fitrobust)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"# the residuals should have mean 0\n# and standard deviation equal to the residual standard deviation\nqqplot(Normal(0, fm1.σ), fm1)","category":"page"},{"location":"api/#General-plots","page":"MixedModelsMakie.jl API","title":"General plots","text":"","category":"section"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"We also provide a splom or scatter-plot matrix plot for data frames with numeric columns (i.e. a matrix of all pairwise plots). These plots can be used to visualize the joint distribution of, say, the parameter estimates from a simulation.","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"using CairoMakie\nusing DataFrames\nusing LinearAlgebra\nusing MixedModelsMakie\n\nsplom!(\n    Figure(; resolution=(800, 800)),\n    DataFrame(rmul!(randn(100, 3), LowerTriangular([1 0 0;1 1 0;-1 -1 1])), [:x, :y, :z]),\n)","category":"page"},{"location":"#MixedModelsMakie.jl-Documentation","page":"MixedModelsMakie.jl Documentation","title":"MixedModelsMakie.jl Documentation","text":"","category":"section"},{"location":"","page":"MixedModelsMakie.jl Documentation","title":"MixedModelsMakie.jl Documentation","text":"CurrentModule = MixedModelsMakie","category":"page"},{"location":"","page":"MixedModelsMakie.jl Documentation","title":"MixedModelsMakie.jl Documentation","text":"MixedModelsMakie.jl is a Julia package providing plotting capabilities for models fit with MixedModels.jl.","category":"page"},{"location":"","page":"MixedModelsMakie.jl Documentation","title":"MixedModelsMakie.jl Documentation","text":"Note that the functionality here is currently early alpha development and so breaking changes are expected as we refine the interface. Following SemVer, these minor releases before 1.0 can introduce these breaking changes. The release of 1.0 will be indication that we believe the interface is reasonably stable.","category":"page"},{"location":"","page":"MixedModelsMakie.jl Documentation","title":"MixedModelsMakie.jl Documentation","text":"Pages = [\n        \"api.md\",\n]\nDepth = 1","category":"page"}]
